import React, { Component } from 'react';
import {Link } from "react-router-dom";
import './EduInformation.css'
import EduInfoLabel from "../EduInfoLabel"; 
import { Col,Row, Container , Image, Jumbotron, Button, Card} from "react-bootstrap";

class EduInformation extends Component{

  render(){


      return(
          <>
          <div>


             <h1 className = "edu-navbar-logo">
             <i className = "fas fa-graduation-cap edu-cap"></i>
                 <p className= "edu-navbar-p">Study Program</p><p className="edu-navbar-p">Recommendation</p><p className="edu-navbar-p">System
             </p></h1>

    <Container>
      <Col>
             <h1 className= "Edu-header">Edit Information</h1>
             <div>



   <ul>
    <Row className= "edu-box">

                  <Card style={{ width: '18rem' }}>
                      <Card.Body>
                        <Card.Title>Card Title</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                        <Card.Text>
                          Some quick example text to build on the card title and make up the bulk of
                          the card's content.
                        </Card.Text>
                        <Card.Link href="#">Card Link</Card.Link>
                        <Card.Link href="#">Another Link</Card.Link>
                      </Card.Body>
                    </Card>


                {
                  EduInfoLabel.EduInfo.map((Info) => {
                    return (
                      <div className= "edu-input-box" >
                        <h4 className= "edu-info-label" >{Info.TestName}</h4>
                        <ul>
                          {
                            Info.ScoreList.map((InfoDetail) => {
                              return (
                                <select className="edu-info" >
                                    <option hidden value="">select score</option>
                                    <option>-</option>
                                    <option value="300">300</option>
                                    <option value="400">400</option>
                                    <option value="500">500</option>
                                    <option value="600">600</option>
                                </select>
                              );
                            })
                          }
                        </ul>
                      </div>
                    );
                  })
                } 
            {/* </div> */}
          </Row>
            </ul>







{/*         
             <Link to="/Test">
                <button className="Edu-back-button">
                  Back
                </button>
                </Link> */}


              <Link to="/Test">
                <button className="Edu-done-button">
                  Done
                </button>
                </Link>



             </div>
             </Col>
            </Container>
          </div>
          </>
      )
  }
}

export default EduInformation;
